import React, {useState} from 'react';
import {Marker, Popup} from "react-leaflet";
import getChargerOperatingMode from "../services/charger/getChargerOperatingMode";
import {STATES} from "../misc/constants";
import {iconAvailable, iconUnavailable} from "../misc/leafletIcons";
import {Link} from "react-router-dom";

const ChargerMarker = (props) => {
    const [active, setActive] = useState(props.active);

    console.log(new Date(props.scheduledEnd))
    return (
        <Marker eventHandlers={{
            click: () => {
                getChargerOperatingMode(props.id).then(x => {
                    if (x !== STATES.NOCARCONNECTED && active !== 1) {
                        setActive(1);
                    }
                })
            }
        }} key={props.id} icon={props.active === 0 ? iconAvailable : iconUnavailable}
                position={[props.latitude, props.longitude]}>
            <Popup>
            <span>
                <h5 className="laddelGreen">{props.ownerUname}</h5>
                <h5>{props.address}</h5>
                {active === 0 ?
                    <Link to={`/charger/${props.id}`}>
                        <button className="popupButton">Reserver</button>
                    </Link> : null}
                </span>
            </Popup>
        </Marker>
    )
}

export default ChargerMarker;
